  return (
    <>
      <Nav>
          <NavLink to="/">
              <h1>NEUROCODING AND NEURODEGENERATIVE DISEASE LAB</h1>
            </NavLink>
            
        

        </Nav> 
    </>
  )
}

export default Navbar
